INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (0, "フリーマーケット会場", "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 40, 8, 2, "ペコリーヌとの出会い", 0, 1, "青空の下で謁見", 91002, 2834, 5118061, 7, 10118);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (0, "フリーマーケット会場", "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 40, 8, 2, "マホとの出会い", 0, 1, "未来の騎空団\nマスコット？", 91002, 2835, 5118062, 7, 10118);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (0, "ランドソル市街地", "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 40, 8, 2, "アキノとの出会い", 0, 1, "お嬢さまからの\n緊急依頼", 91002, 2837, 5118063, 7, 10118);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (0, "フリーマーケット会場", "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 40, 8, 2, "ジュンとの出会い", 0, 1, "黄金色の悩みごと", 91002, 4108402, 5118064, 18, 10118);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (0, "フリーマーケット会場", "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 40, 8, 2, "カオリとの出会い", 0, 1, "白熱！　格闘大会！", 91002, 4107402, 5118065, 18, 10118);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (0, "オーエド町", "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 40, 8, 2, "ニノンとの出会い", 1, 1, "祭り太鼓はオーエドの華", 91002, 9000227, 5118066, 16, 10118);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (0, "フリーマーケット会場", "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 40, 8, 3, "スズナとの出会い", 0, 1, "人気者は遅れて\nやってくる", 91002, 2101181, 5118067, 19, 10118);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (0, "ランドソル市街地", "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 40, 8, 3, "ナナカとの出会い", 0, 1, "巫女・ミーツ・魔法少女", 91002, 4109402, 5118068, 18, 10118);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (0, "フリーマーケット会場", "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 40, 8, 3, "キャル＆コッコロとの出会い", 0, 1, "ネズ耳は二度なくなる", 91002, 4305402, 5118069, 18, 10118);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (0, "ランドソル市街地", "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 40, 8, 3, "ユカリとの出会い", 0, 1, "この出会いにカンパイ！", 91002, 4101402, 5118070, 18, 10118);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (0, "ランドソル市街地", "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 40, 8, 3, "アオイとの出会い", 0, 1, "陰陽アンサンブル", 91002, 4106402, 5118071, 18, 10118);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (0, "フリーマーケット会場", "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 40, 8, 3, "シノブとの出会い", 1, 1, "運試し十番勝負！", 91002, 2836, 5118072, 7, 10118);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (10145115, 0, 0, 0, 0, 1, "オープニング", 0, 0, "彼女たちの新たな日常", 0, 0, 5118600, 0, 10118);
